// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./IPancakeFactory.sol";
import "./IPancakeRouter02.sol";
import "./DeFiToken.sol";
import "./NFTToken.sol";
import "./Pair.sol";

contract LiquidityPool {
    PancakeswapFactoryInterface pancakeswapFactory;
    IPancakeRouter02 pancakeswapRouter;

    // Test Tokens (for swap)
    DeFiToken public deFiToken1;
    DeFiToken public deFiToken2;
    DeFiToken public deFiToken3;
    DeFiToken public deFiToken4;
    DeFiToken public deFiToken5;

    NFTToken public nftToken1;
    NFTToken public nftToken2;
    NFTToken public nftToken3;
    NFTToken public nftToken4;
    NFTToken public nftToken5;

    constructor() {
        // TESTNET
        pancakeswapFactory = PancakeswapFactoryInterface(
            0x6725F303b657a9451d8BA641348b6761A6CC7a17
        );

        pancakeswapRouter = IPancakeRouter02(
            0xD99D1c33F9fC3444f8101754aBC46c52416550D1
        );

        nftToken1 = NFTToken(0x76adfDeBF139229A0Eb68ff20EEDFE52137C9A5c);
        nftToken2 = NFTToken(0xB3a1E1F069fbb36a108D941dE6155B92eD0F373A);
        nftToken3 = NFTToken(0x9EaE6f63E65380C9D536006A1bc46590cF00947A);
        nftToken4 = NFTToken(0x1b5faA45Da485F0606739738316F7d6060B9C1a6);
        nftToken5 = NFTToken(0x2F20638fbAF9052347f5ac1bDf10b56a6eF2eAf0);

        deFiToken1 = DeFiToken(0xdB869dB63134F187226Cb15d89d8C73D4F1E165F);
        deFiToken2 = DeFiToken(0xBe330AfB7C70F9093772478acfFAe8816166148b);
        deFiToken3 = DeFiToken(0x174C156683a8cb6A68aC12Ce0e6a6963e32a0718);
        deFiToken4 = DeFiToken(0x2Ac80247c9E99B8452cC8110e21E9A62F8b36f7d);
        deFiToken5 = DeFiToken(0x042518d25dC5e12675eF09cE173eF129CC781E79);
    }

    function mintDeFi(uint256 amount) public {
        deFiToken1.mint(msg.sender, amount);
        deFiToken2.mint(msg.sender, amount);
        deFiToken3.mint(msg.sender, amount);
        deFiToken4.mint(msg.sender, amount);
        deFiToken5.mint(msg.sender, amount);
    }

    function mintNFT(uint256 amount) public {
        nftToken1.mint(msg.sender, amount);
        nftToken2.mint(msg.sender, amount);
        nftToken3.mint(msg.sender, amount);
        nftToken4.mint(msg.sender, amount);
        nftToken5.mint(msg.sender, amount);
    }

    function getDeFiBalance() public view returns (uint256) {
        return deFiToken1.balanceOf(msg.sender);
    }

    function getNFTBalance() public view returns (uint256) {
        return nftToken1.balanceOf(msg.sender);
    }
}
